import React, { Component } from 'react';
import './App.css';
import callAPI from './modules/FetchAPI'

class App extends Component {
  render() {
    let students 
    callAPI().then(data=>{
      students=data
      console.log(data)
    })
    return (
      <div className="page">
      {students && console.log(students)
      }
      </div>
    );
  }
}

export default App;
